{
	"root": true,
	"extends": [
		"eslint:recommended",
		"plugin:@typescript-eslint/eslint-recommended",
		"plugin:@typescript-eslint/recommended",
		"plugin:cypress/recommended"
	],
	"env": {
		"browser": true,
		"node": true,
		"es6": true,
		"cypress/globals": true
	},
	"parser": "@typescript-eslint/parser",
	"plugins": ["import", "@typescript-eslint"],
	"rules": {
		"@typescript-eslint/no-non-null-assertion": "off",
		"@typescript-eslint/no-explicit-any": "off",
		"no-console": "off",
		"@typescript-eslint/ban-ts-comment": "off",
		"no-async-promise-executor": "off",
		"no-debugger": "warn",
		"@typescript-eslint/no-inferrable-types": "off",
		"@typescript-eslint/no-unused-vars": [
			"error",
			{
				"argsIgnorePattern": "^_"
			}
		],
		"@typescript-eslint/consistent-type-imports": [
			"warn",
			{
				"prefer": "type-imports",
				"fixStyle": "separate-type-imports",
				"disallowTypeAnnotations": false
			}
		],
		"import/no-anonymous-default-export": ["error"]
	}
}

// eslint-disable-next-line import/no-anonymous-default-export
module.exports = {
	testMatch: ['**/?(*.)+(spec|test).[jt]s?(x)'],
	moduleFileExtensions: ['ts', 'js', 'mjs', 'html'],
	coverageReporters: ['html'],
	transform: {
		'^.+\\.(ts|html)$': 'ts-jest',
	},
	testEnvironment: 'jsdom',
	/**
	 * manually set the exports names to load in common js, to mimic the behaviors of jest 27
	 * before jest didn't fully support package exports and would load in common js code (typically via main field). now jest 28+ will load in the browser esm code, but jest esm support is not fully supported.
	 * In this case we will tell jest to load in the common js code regardless of environment.
	 *
	 * this can be removed via just overriding this setting in it's usage
	 *
	 * @example
	 * module.exports = {
	 *   ...nxPreset,
	 *   testEnvironmentOptions: {},
	 * }
	 */
	testEnvironmentOptions: {
		customExportConditions: ['node', 'require', 'default'],
	},
};

server {
  listen 80;
  server_name redeye;
  client_max_body_size 500M;

  location / {
    proxy_pass http://localhost:4000;
    proxy_set_header        X-Real-IP $remote_addr;
    proxy_set_header        X-Forwarded-For $proxy_add_x_forwarded_for;
    proxy_set_header        X-Forwarded-Proto $scheme;
    proxy_set_header        X-Forwarded-Proto-Version $http2;
    proxy_set_header        Host $http_host;
    proxy_set_header        X-NginX-Proxy true;
    proxy_set_header        Connection "";

    expires                 0;
    add_header              Pragma public;
    add_header              Cache-Control "public";
    access_log              off;

    add_header X-XSS-Protection         "1; mode=block";
    add_header X-Frame-Options          "deny";
    add_header X-Content-Type-Options   "nosniff";
  }
}

{
	"compilerOptions": {
		"experimentalDecorators": true,
		"resolveJsonModule": true,
		"esModuleInterop": true,
		"skipLibCheck": true,
		"moduleResolution": "nodenext",
		"module": "esnext",
		"target": "esnext",
		"baseUrl": "."
	},
	"exclude": ["applications/redeye-e2e/*", "tmp", "applications/redeye-e2e/cypress.config.js", "node_modules"],
	"references": [
		{
			"path": "applications/client"
		},
		{
			"path": "applications/server"
		},
		{
			"path": "docs/landing-page"
		},
		{
			"path": "packages/graph"
		},
		{
			"path": "packages/migrations"
		},
		{
			"path": "packages/models"
		},
		{
			"path": "packages/ui-styles"
		},
		{
			"path": "parsers/brute-ratel-parser"
		},
		{
			"path": "parsers/cobalt-strike-parser"
		},
		{
			"path": "parsers/parser-core"
		},
		{
			"path": "parsers/sliver-parser"
		}
	]
}
